# Dmitriyevka, Dmitriyevsky Selsoviet, Chishminsky District, Republic of Bashkortostan

}}
Dmitriyevka () is a rural locality (a village) and the administrative seat of Dmitriyevsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The population was 277 as of 2010.
Geography
It is located 25&nbsp;km from Chishmy.
